INSERT INTO cfdi_40_claves_unidades VALUES('A91','Grado centesimal','Sinónimo: grado\nEl grado centesimal o gon —también llamado gradián (plural: gradianes) y gonio — es una unidad de medida de ángulos planos, alternativa al grado sexagesimal y al radián.','Unidades no recomendadas para su uso por la Oficina Internacional de Pesos y Medidas (BIPM) con sede en Francia.','2022-01-01','','gon');
