INSERT INTO cfdi_40_claves_unidades VALUES('AMP','Amperio','Es la intensidad de una corriente constante que manteniéndose en dos conductores paralelos, rectilíneos, de longitud infinita, de sección circular despreciable y situados a una distancia de un metro uno de otro en el vacío, produciría una fuerza igual a 2·10-7 newton por metro de longitud.','','2022-01-01','','A');
