INSERT INTO cfdi_40_claves_unidades VALUES('ATM','Atmósfera estándar','Es un modelo de la atmósfera terrestre que permite obtener los valores de presión, temperatura, densidad y viscosidad del aire en función de la altitud. Su función es proporcionar un marco de referencia invariante para la navegación aérea y para la realización de cálculos aerodinámicos consistentes.','','2022-01-01','','atm');
